import React, { Component } from 'react';
import axios from "axios";
import {Link} from "react-router-dom";
import './user.css';


class Users extends Component {
    constructor(props){
        super(props);
        this.state={users:[]};
    }


    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/users').
        then(res => this.setState({users : res.data})).
        catch(err => console.log(err));
    }


    render() {
        var users= this.state.users.map((item,index)=>{
            return<div key={index}>
                <div>
                    <p>ID:{item.id}</p>
                    Name:<input type='text' value='{item.name}'/><br/>
                    <input type='text'/>Email:{item.email}<br/>
                    <div className='user-btn btn-other'><p>Other Data</p></div>
                    <div className='user-btn btn-update'><p>Update</p></div>
                    <div className='user-btn btn-delete'><p>Delete</p></div>
                </div>
                <div className='otherData'>
                    <input type='text'/>Street:{item.address.street}<br/>
                    <input type='text'/>City:{item.address.city}<br/>
                    <input type='text'/>Zipcode:{item.address.zipcode}<br/>
                </div>
                </div>
        });


        return (
            <div id="Users">
                PRINT USERS
                    {users}
                </div>
                );
    }
}

export default Users;
